import React from "react";
import "../pages.css";
import { useState, useEffect } from "react";
import Header from "../components/header";
import axios from "axios";

const JobPosts = () => {
  const [jobs, setJobs] = useState([]);
  const [errors, setErrors] = useState("");

  useEffect(() => {
    axios
      .get("http://127.0.0.1:1111/api/v1/job-listings/")
      .then((response) => {
        setJobs(response.data);
      })
      .catch((error) => {
        setErrors(error.message);
      });
  }, []);

  if (errors) {
    return (
      <>
        <Header />
        <p>{errors}</p>
      </>
    );
  }

  return (
    <>
      <Header />
      <h1 style={{ padding: "20px 0px 20px" }}>Available jobs for you</h1>

      <ul>
        {jobs.map((job) => (
          <li key={job.id}>
            <div className="jobs-post">
              <h3>{job.job_title}</h3>
              <p>{job.job_description}</p>
              <p>Enumeration: {job.enumeration}</p>
              <hr />
            </div>
          </li>
        ))}
      </ul>
    </>
  );
};

export default JobPosts;
